// SPDX-License-Identifier: MIT

pragma solidity 0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../UniswapConnector.sol";

contract ConsumerMock {
    UniswapConnector public connector;

    event Swap(uint256 remainingIn, uint256 amountOut);

    constructor(UniswapConnector _connector) {
        connector = _connector;
    }

    function swap(address tokenIn, address tokenOut, uint256 amountIn, uint256 minAmountOut, uint256 deadline, bytes memory data) external {
        (uint256 remainingIn, uint256 amountOut) = connector.swap(tokenIn, tokenOut, amountIn, minAmountOut, deadline, data);
        emit Swap(remainingIn, amountOut);
    }
}

